       {expenseTitle:'Car Insurance',amount:9999,date: new Date(2021,2,28)},
       {expenseTitle:'Car Insurance',amount:9999,date: new Date(2021,2,28)}
    ];


  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem 
      title={expenseData[0].expenseTitle}
      amount={expenseData[0].amount}
      date={expenseData[0].date}
      ></ExpenseItem>
      <ExpenseItem
       amount={expenseData[1].amount}
      date={expenseData[1].date}
      ></ExpenseItem>
      <ExpenseItem
      title={expenseData[2].expenseTitle}
      amount={expenseData[2].amount}
      date={expenseData[2].date}
      ></ExpenseItem>
    </div>
  );
}

export default App;
